import { Component, OnInit } from '@angular/core';

@Component({
  selector:'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss'],


})

export class HomeComponent implements OnInit {
  numbersClicked: number[] = [];
  generatedNumbers: number[] = [];
  resultMessage: string = '';
  secretNumbersVisible: boolean = false;

  ngOnInit(): void {
    // Your JavaScript code here
    this.generateRandomNumbersOrdered(15);
  }

  generateRandomNumbersOrdered(quantityNumbers: number) {
    while (this.generatedNumbers.length < quantityNumbers) {
      let randomNumbers = Math.floor(Math.random() * 25) + 1;

      if (this.generatedNumbers.indexOf(randomNumbers) === -1) {
        this.generatedNumbers.push(randomNumbers);
      }
    }
    this.generatedNumbers.sort((a, b) => a - b);
  }

  revealNumbers() {
    this.secretNumbersVisible = !this.secretNumbersVisible;
  }

  onClickNumber(number: number) {
    const index = this.numbersClicked.indexOf(number);
    if (index !== -1) {
      this.numbersClicked.splice(index, 1);
    } else {
      this.numbersClicked.push(number);
    }
  }

  toPlay() {
    if (this.numbersClicked.length === 0 || this.generatedNumbers.length === 0) {
      this.resultMessage = 'Você precisa gerar os números ou selecionar na cartela';
    } else if (this.numbersClicked.toString() === this.generatedNumbers.toString()) {
      this.resultMessage = `Parabéns você ganhou ${this.numbersClicked.join(' ')}`;
    } else {
      this.resultMessage = `Não foi dessa vez ${this.numbersClicked.join(' ')}`;
    }
  }

  restartGame() {
    window.location.reload();
  }
}




<main class="container--card">
  <h2>Super Loto  Marque 15 numeros</h2>
<section class="section">
  <div class="generate-numbers-reveal">
    <button class="generate-numbers-button" (click)="generateRandomNumbersOrdered(15)">
      <label>Gerar números</label>
    </button>

    <button class="button-reveal-numbers" (click)="revealNumbers()">
      <i class="fa-regular fa-eye-slash"></i>
      <label>Revelar</label>
    </button>
  </div>

  <div class="reveal--numbers">
    <span *ngIf="secretNumbersVisible" id="secretNumbers">{{ generatedNumbers.join(' ') }}</span>
  </div>

  <table class="numbers--table" id="numbersTable">
    <tr *ngFor="let row of [0,1,2,3,4]">
      <td *ngFor="let col of [0,1,2,3,4]">
        <button class="button-select-card-numbers" (click)="onClickNumber(row * 5 + col + 1)"
          [ngClass]="{ 'button-select-card-numbers-toggle': numbersClicked.includes(row * 5 + col + 1) }">
          {{ row * 5 + col + 1 }}
        </button>
      </td>
    </tr>
  </table>

  <div class="play--restart">
    <button class="play--button" (click)="toPlay()">
      <label>Jogar</label>
    </button>

    <button class="restart--button" (click)="restartGame()">
      <label>Reiniciar Jogo</label>
    </button>
  </div>

  <div class="result-play">
    <div class="result" id="result">{{ resultMessage }}</div>
  </div>
</section>
</main>
